/*----------------------------------------------------------------------------------------------------------------------
Function: AudioTestInitialize

Description:
Initializes the State Machine and its variables.

Requires:
  -

Promises:
  - 
*/
void AudioTestInitialize(void)
{
  u8* pu8Parser;
  u8 au8AudioTestStartupMsg[] = "\n\rMIDI Player\n\rB0: Stop playback / Toggle verbose\n\rB1: Game of Thrones Theme\n\rB2: Let Her Go\n\rB3: Let It Go from Frozen\n\r";
  //NumberToAscii((55*pow(2,(n-21)/12))/2, au8AudioTestStartupMsg);

  /* Starting LEDs */
  LedOn(WHITE);
  LedOff(PURPLE);
  LedOff(ORANGE);
  LedOff(CYAN);
  LedOff(BLUE);
  LedOff(GREEN);
  LedOff(YELLOW);
  LedOff(RED);
  LedOff(LCD_RED);
  LedOff(LCD_GREEN);
  LedOff(LCD_BLUE);
  
  /* Starting point in Song */
  AudioTest_u32Position = 0;
  AudioTest_u32Delay = 0;
  AudioTest_song = NULL;
  
  /* Starting frequencies */
  PWMAudioSetFrequency(AT91C_PWMC_CHID0, 1000);
  PWMAudioSetFrequency(AT91C_PWMC_CHID1, 1100);

  /* Init complete: set function pointer and application flag */
  AudioTest_u32Timeout = G_u32SystemTime1ms;
  pu8Parser = &au8AudioTestStartupMsg[0];
  while(*pu8Parser != NULL)
  {
    /* Attempt to queue the character */
    if( Uart_putc(*pu8Parser) )
    {
      /* Advance only if character has been sent */
      pu8Parser++;
    }
       
    /* Watch for timeout */
    if( IsTimeUp(&AudioTest_u32Timeout, UTEST_INIT_MSG_TIMEOUT) )
    {
      break;
    }
  }
  
  AudioTest_u32Timeout = G_u32SystemTime1ms;
  G_AudioTestStateMachine = AudioTestSM_Idle;

} /* end AudioTestInitialize() */


