void UartPrint(u8 au8Msg[])
{
  u8* pu8Parser;

  /* Init complete: set function pointer and application flag */
  Print_u32Timeout = G_u32SystemTime1ms;
  pu8Parser = &au8Msg[0];
  while(*pu8Parser != NULL)
  {
    /* Attempt to queue the character */
    if( Uart_putc(*pu8Parser) )
    {
      /* Advance only if character has been sent */
      pu8Parser++;
    }
       
    /* Watch for timeout */
    if( IsTimeUp(&Print_u32Timeout, UTEST_INIT_MSG_TIMEOUT) )
    {
      break;
    }
  }

} /* end UartPrint() */


