/*--------------------------------------------------------------------------------------------------------------------*/
void AudioTestSM_Idle(void)
{
  u16 freq;
  u8 uartTxt [256];
  static bool verbose = FALSE;
    
  if ( IsButtonPressed(BUTTON0) && AudioTest_song != NULL )
  {
    ButtonAcknowledge(BUTTON0);
    AudioTest_song = NULL;
    PWMAudioOff(AT91C_PWMC_CHID0);
    PWMAudioOff(AT91C_PWMC_CHID1);
    AudioTest_u32Position = 0;
    UartPrint ("\n\r======================================\n\r");
    UartPrint ("Playback Stopped");
    UartPrint ("\n\r======================================\n\r");
  }
  if ( IsTimeUp(&AudioTest_u32Timeout, AudioTest_u32Delay) && AudioTest_song != NULL )
  {
    /* Check for buzzer zero set freq flag "0x90" */
    if (AudioTest_song[AudioTest_u32Position] == 0x90)
    {
      freq = (u16)floor( 27.5 * pow(2.0,(float)(AudioTest_song[AudioTest_u32Position+1]-21)/12.0) );
      PWMAudioSetFrequency(AT91C_PWMC_CHID0, freq);
      PWMAudioOn(AT91C_PWMC_CHID0);
      AudioTest_u32Position += 2;
      if (verbose){
        UartPrint ("Buzzer 0 On @ ");
        NumberToAscii(freq, uartTxt);
        UartPrint (uartTxt);
        UartPrint (" Hz | ");
      }
    }
    /* Check for buzzer one set freq flag "0x91" */
    else if (AudioTest_song[AudioTest_u32Position] == 0x91)
    {
      freq = (u16)floor( 27.5 * pow(2.0,(float)(AudioTest_song[AudioTest_u32Position+1]-21)/12.0) );
      PWMAudioSetFrequency(AT91C_PWMC_CHID1, freq);
      PWMAudioOn(AT91C_PWMC_CHID1);
      AudioTest_u32Position += 2;
      if (verbose){
        UartPrint ("Buzzer 1 On @ ");
        NumberToAscii(freq, uartTxt);
        UartPrint (uartTxt);
        UartPrint (" Hz | ");
      }
    }
    /* Check for buzzer zero set stop flag "0x80" */
    else if (AudioTest_song[AudioTest_u32Position] == 0x80)
    { 
      PWMAudioOff(AT91C_PWMC_CHID0);
      AudioTest_u32Position += 1;
      if (verbose){
        UartPrint ("Buzzer 0 Off | ");
      }
    }
    /* Check for buzzer one set stop flag "0x81" */
    else if (AudioTest_song[AudioTest_u32Position] == 0x81)
    {
      PWMAudioOff(AT91C_PWMC_CHID1);
      AudioTest_u32Position += 1;
      if (verbose){
        UartPrint ("Buzzer 1 Off | ");
      }
    }
    /* Check for delay flag "0XXX XXXX" */
    else if ((0x80 & AudioTest_song[AudioTest_u32Position]) == 0)
    {
      AudioTest_u32Timeout = G_u32SystemTime1ms;
      AudioTest_u32Delay = (AudioTest_song[AudioTest_u32Position] << 8) | AudioTest_song[AudioTest_u32Position+1];
      AudioTest_u32Position += 2;
      if (verbose){
        UartPrint ("Delaying for ");
        NumberToAscii(AudioTest_u32Delay, uartTxt);
        UartPrint (uartTxt);
        UartPrint (" ms\n\r");
      }
    }
    /* Check for end flag "0xF0" */
    else if (AudioTest_song[AudioTest_u32Position] == 0xF0)
    {
      AudioTest_song = NULL;
      AudioTest_u32Position = 0;
      UartPrint ("\n\rEnd of Playback\n\r");
      UartPrint ("======================================\n\r");
    }    
  } else if ( AudioTest_song == NULL) 
  {
    /*  Song Playback controls */
    if (WasButtonPressed(BUTTON0) )
    {
      ButtonAcknowledge(BUTTON0);
      
      if(verbose)
      {
        verbose = FALSE;
        UartPrint ("\n\rVerbose mode off\n\r");
      }
      else
      {
        verbose = TRUE;
        UartPrint ("\n\rVerbose mode on\n\r");
      }
    }
    
    
    if (IsButtonPressed(BUTTON1) )
    {
      AudioTest_song = (u8*)AudioTest_gameOfThrones;
      UartPrint ("\n\r======================================\n\r");
      UartPrint ("Playing: Game of Thrones Theme\n\r\n\r");
      UartPrint (au8AudioTest_gameOfThronesArt);
      AudioTest_u32Position = 0;
    }
    else if (IsButtonPressed(BUTTON2) )
    {
      AudioTest_song = (u8*)AudioTest_letHerGo;
      UartPrint ("\n\r======================================\n\r");
      UartPrint ("Playing: Let Her Go by Passenger\n\r\n\r");
      UartPrint (au8AudioTest_passengerArt);
      AudioTest_u32Position = 0;
    }
    else if (IsButtonPressed(BUTTON3) )
    {
      AudioTest_song = (u8*)AudioTest_letItGo;
      UartPrint ("\n\r======================================\n\r");
      UartPrint ("Playing: Let It Go from Frozen\n\r\n\r");
      UartPrint (au8AudioTest_LetItGoArt1);
      UartPrint (au8AudioTest_LetItGoArt2);
      AudioTest_u32Position = 0;
    }
  }
} /* end AudioTestSM_Idle() */


/*--------------------------------------------------------------------------------------------------------------------*/
/* Handle an error */
void AudioTestSM_Error(void)          
{
  G_AudioTestStateMachine = AudioTestSM_Idle;
  
} /* end AudioTestSM_Error() */


